As our partner, you can submit initiatives for different project models according to the modules available for student learning. The fruits of this partnership are diverse:

- At the end of the project, up to 5 prototypes will be made available for use by the partner;
- the partnership has no financial investment;
- the Partner can carry out various projects together with Inteli;
- ease of hiring;
- speed up the validation of an idea;
- we are always accepting new initiatives.
